import React from 'react';
import Button from '../../common/button/Button'
import '../header/Header.css'

export default function Header() {

    return (
        <div className="header">
            <div className="col-1">
                <div id="row-1">
                    <div id="text-container"><h1>DESIGNER</h1></div>
                    <div id="text-container"><h1>CREATOR</h1></div>
                    <div id="text-container"><h1>ENGINEER.</h1></div>
                </div>
                <a href="/#"><Button
                    fontSize={'1.4em'}
                    textColor={'white'}
                    borderWidth={1}
                    borderColor={'white'}
                    buttonText={'VIEW MY WORK'}
                    backgroundColor={'transparent'}
                    fontWeight={600}
                    padding={'1em 2em'}
                /></a>
            </div>
            <div className="row-2">
                <a href="/#"><img src="./assets/GitHub-Mark-Light-120px-plus.png" alt="Github" /></a>
            </div>
        </div>
    );
}
